import React, { useContext } from 'react'
import Item from './Item'
import { GlobalContext } from '../context/GlobalContext'

export default function Itemlist() {
  const { products } = useContext(GlobalContext)
  return (
    <div className="py-5">
      <div className="row">
        {products.map((product) => <Item />)}
      </div>
    </div>
  )
}
